import React, { useState } from 'react'

 const Click = () => {
    const[data,setdata]=useState(0)
    const handlechange =() =>{
          setdata(data+1);
    }
  return (
    <div>
        <button onClick={handlechange}>Clicked {data} Times</button>
    </div>
  )
}
export default Click
